    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-09-26T19:57:40.554842",nt"name": "ex1105-field-trials-of-em302-multibeam-sonar-water-column-backscatter-on-noaa-ship-okeanos-expl8d908",nt"isopen":
    false,nt"url": null,nt"notes": "During this OER project in partnership
    with NOAA's National Marine Fisheries Service and the Bureau of Ocean Energy Management,
    Regulation, and Enforcement (BOEMRE), two ships will work collaboratively in the
    Gulf of Mexico to map known targets of man-made or natural seeps to test the use
    of their sensors to detect these seeps.  The NOAA Ship Pisces will utilize its ME70
    multibeam sonar sensor and the Okeanos Explorer will use its state-of-the-art Kongsberg
    EM302 multibeam sonar system and its newly acquired EK60 echosounder.  Of special
    interest to the objectives of this mission is the water column backscatter data
    component of the EM302 multibeam survey system.  These data will be analyzed as
    they are collected over known natural and man-made seeps in the Gulf of Mexico and,
    along with the data from the newly acquired EK60 echosounder, will be compared to
    those data collected by the Pisces ME70 and single beam sonar sensors.",nt"license_title":
